Декларация по УСН: строка 210 раздела 2;
по данным налогового учета УСН в случае
отсутствия декларации

В информационной базе не хранятся данные для определения фактов приближения к предельным
значениям в части ЕНВД:
1. Площадь торгового зала магазина или павильона по каждому объекту организации розничной
торговли не более 150 кв. метров;
2. Площадь зала обслуживания посетителей по каждому объекту организации общественного питания,
имеющему зал обслуживания посетителей не более 150 кв. метров;
3. Количество автотранспортных средств, предназначенных для оказания автотранспортных услуг,
не более 20 единиц;
4. Общая площадь спальных помещений в каждом объекте, используемом для оказания услуг по
временному размещению и проживанию, не более 500 кв. метров.

К деятельности с высоким налоговым риском ФНС относит следующие схемы:
1. Схемы получения необоснованной налоговой выгоды с использованием фирм-"однодневок":
  1.1. Схема с использованием фирм - "однодневок" для создания фиктивных расходов и получения
вычетов по косвенным налогам без соответствующего движения товара (работ, услуг);
  1.2. Схема с использованием фирм - "однодневок" с целью увеличения добавленной стоимости товара,
уменьшения налоговой нагрузки на производственные подразделения;
2. Схема получения необоснованной налоговой выгоды при реализации недвижимого имущества;
3. Схема получения необоснованной налоговой выгоды при  производстве алкогольной и
спиртосодержащей продукции;
4. Схема получения необоснованной налоговой выгоды с использованием инвалидов;
5. Схема получения необоснованной налоговой выгоды путем включения в хозяйственный оборот
посредников (как российских, так и иностранных), деятельность которых сводится к созданию
видимости осуществления реальной финансово-хозяйственной деятельности;
6. Схема получения необоснованной налоговой выгоды путем приобретения фиктивных инвестиционных
инструментов.
